import React from 'react';

const Home = () => {
  return (
    <section id="home" className="home-section">
      <div className="container">
        <h1>Welcome to Pure Cleaning</h1>
        <p>Your go-to solution for professional commercial cleaning.</p>
      </div>
    </section>
  );
};

export default Home;
